(43, '486702a222224c41f9e243713d03f27a', 'Random Esoteric Creature Generator for Classic Fantasy Rpgs & Their Modern Simulacra', 'Toys & Games | Games & Accessories', 'Make sure this fits by entering your model number. | Looking to instill a little fear in your Game? Then look no further! | Nothing brings the thrill – and terror – of discovery to a Game like new monsters. Faced with the unknown, mighty-thewed heroes tremble in their hauberks, Wizen Wizards fumble with their spell books, and even the most audacious of rogues hesitate before plunging into battle. | Nevermore worry that your players have memorized every monster’s stat, power and weakness. Nevermore Resort to tired fantasy clichés, and worn out monsters fought a thousand times before. The random esoteric creature generator ensures that each Monster your PCs cross is unique, unexpected, and best of all – Unknown. | With an unlimited number of horrific combinations, This is the last Monster book you will ever need.  Bring terror back to the table with the random esoteric creature generator!', 'ProductDimensions:8.2x5.8x0.2inches|ItemWeight:5.6ounces|ShippingWeight:5.6ounces(Viewshippingratesandpolicies)|ASIN:9527238269|Itemmodelnumber:LFP0059|Manufacturerrecommendedage:14yearsandup', 'https://images-na.ssl-images-amazon.com/images/I/51oatsxdgAL.jpg|https://images-na.ssl-images-amazon.com/images/G/01/x-locale/common/transparent-pixel.jpg', '$19.94'),
