(51, '2d835e536f3e4aed4005091fe3955ebb', 'LAMO 5\" Vinyl Figure - Legacy Gamers Dr Disrespect, Red', '', 'Make sure this fits by entering your model number. | 5” stylized Dr DisRespect figure comes with a unique, one-time-use QR card that unlocks the character in the free LAMO: AR vinyl app. | LAMO is a fast paced, free-to-play, online multiplayer party game. | LAMO is a 3-part ecosystem: (1) a fun online party game, (2) a covetable collectible vinyl figure and (3) a mobile app that connects the two, bridging the digital and the physical. | Collect, display and play with all LAMO vinyl figures. | LAMO is made by gamers, for gamers, with gamers.', 'ProductDimensions:5x5.2x7inches|ItemWeight:8ounces|ShippingWeight:8ounces(Viewshippingratesandpolicies)|ASIN:B07VMHS625|Itemmodelnumber:29006|Manufacturerrecommendedage:6yearsandup', 'https://images-na.ssl-images-amazon.com/images/I/41gD5AyOeNL.jpg|https://images-na.ssl-images-amazon.com/images/I/41fEVG-LshL.jpg|https://images-na.ssl-images-amazon.com/images/I/51wUFtbIxmL.jpg|https://images-na.ssl-images-amazon.com/images/I/41LLxEznX6L.jpg|https://images-na.ssl-images-amazon.com/images/I/41imbD0WUOL.jpg|https://images-na.ssl-images-amazon.com/images/I/41kJk9KT0HL.jpg|https://images-na.ssl-images-amazon.com/images/I/519bnC2K86L.jpg|https://images-na.ssl-images-amazon.com/images/G/01/x-locale/common/transparent-pixel.jpg', '$19.50'),
