(168, 'f4d3330e05b15674aa1f2c5b4d044cd4', 'Carrera 23856 Ferrari 512 S Berlinetta Scuderia Filipinetti #3 1970 Digital 124 Slot Car 1:24 Scale', 'Toys & Games | Hobbies | Slot Cars, Race Tracks & Accessories | Slot Cars', 'Make sure this fits by entering your model number. | Add the 1: 24 scale Ferrari 512S Scuderia filipinetti no. 3 1970 to your Carrera digital 124 slot car racing collection | Carrera Part No. 20023856 | High-quality tampo-printing for durability and attention to even the smallest of details gives the car its original look | Working front headlights and rear brake light are standard and provide an even more authentic look while realistic acceleration and braking action provides the authentic feel | This digital 124 vehicle will work on Carrera digital 124 and 132 tracks as well as Evolution or exclusive Analog tracks', 'ProductDimensions:10x5x6inches|ItemWeight:1.54pounds|ShippingWeight:1.54pounds(Viewshippingratesandpolicies)|ASIN:B07BPD7SCG|Itemmodelnumber:23856|Manufacturerrecommendedage:8yearsandup', 'https://images-na.ssl-images-amazon.com/images/I/516o2%2BLP8UL.jpg|https://images-na.ssl-images-amazon.com/images/G/01/x-locale/common/transparent-pixel.jpg', '$75.01'),
