(172, '19ef9573802bf0c2d880c55e29c92003', 'Sport Squad HX40 40 inch Table Top Air Hockey Table for Kids and Adults - Electric Motor Fan - Includes 2 Pushers and 2 Air Hockey Pucks - Great for Playing on The Floor, Tabletop, or Dorm Room', 'Sports & Outdoors | Sports & Fitness | Leisure Sports & Game Room | Arcade & Table Games | Air Hockey', 'Make sure this fits by entering your model number. | HIGH OUTPUT FAN CREATES A REALISTIC ARCADE-STYLE GAME PLAY: Powered by AC-12V motor and included adapter, the electric fan provides powerful, yet quiet and even airflow for a smooth and frictionless playing surface. | 5 MINUTE EASY ASSEMBLY: Simply attach the 2 goal boxes and you’re ready to play! Comes with 2 air hockey strikers and 2 pucks. The manual sliding abacus scorers help keep track of total goals and the goal boxes offer convenient hockey puck return. | PORTABLE, COMPACT DESIGN: Fun and competitive, the HX40 slide hockey table is made of durable MDF. DIMS: 40\"L x 20\"W x 5\"H and weighs 14 lbs. The compact air hockey table features non-marking rubber pads to protect all your table surfaces. | 100% SATISFACTION GUARANTEE: Sport Squad listens and learns from your feedback to create quality gameroom equipment for kids & adults. If you\'re not 100% satisfied or have product suggestions our customer service team is available to help. | SPORT SQUAD - BRINGING FAMILY AND FRIENDS TOGETHER: As an American based company, Sport Squad brings new innovation to playing indoors and outdoors by introducing affordable, quality sports, lawn, tailgate, carnival, and game room games to market.', 'Shipping Weight: 16.7 pounds (View shipping rates and policies)|ASIN: B07XHNRD8M|    #130    in Air Hockey Tables & Equipment', 'https://images-na.ssl-images-amazon.com/images/I/411oEZARArL.jpg|https://images-na.ssl-images-amazon.com/images/I/51socFVn0AL.jpg|https://images-na.ssl-images-amazon.com/images/I/511oDnrLatL.jpg|https://images-na.ssl-images-amazon.com/images/I/51AgW5pbeDL.jpg|https://images-na.ssl-images-amazon.com/images/I/51GLmXv4IML.jpg|https://images-na.ssl-images-amazon.com/images/I/51bxnxoxMvL.jpg|https://images-na.ssl-images-amazon.com/images/G/01/x-locale/common/transparent-pixel.jpg', '$67.95'),
(173, '9a368eab9859f79f2850773b36b01917', 'BeginAgain BuddyBlocks Safari Animals - Matching and Problem Solving - Kids 18 Months and Up', 'Toys & Games | Baby & Toddler Toys | Sorting & Stacking Toys', 'Make sure this fits by entering your model number. | PERFECT FOR HANDS-ON LEARNING: The BuddyBlocks Safari Animals are fun and colorful building blocks for toddlers that double as a baby animals puzzle. Stack, roll, grab, or piece together the animal toy puzzle for endless hands-on learning fun | 6 PUZZLES IN 1: The BuddyBlocks Safari Animals features six different animal designs printed on each side of the four puzzle cubes. Accurately match all four sides to reveal the animal! | ECO-FRIENDLY TOYS: At BeginAgain Toys, all of the products are designed with the environment in mind. Wood is sustainably harvested from Rubber Trees to make all of the wooden pieces and playsets, while the sap of the tree is converted into the natural rubber bath toys. Any products that contain plastic have been created using recycled plastics as well as bioplastics made from sugar, wheat and corn. BeginAgain is working towards a greener world one toy at a time! | MAKES A PERFECT GIFT: Whether you\'ve got a little one in your life, or need an excellent birthday or baby shower gift, BeginAgain is here to help! With toys that help promote fine motor skills and puzzles that help improve cognitive functions, BeginAgain has something for every child no matter the age or the occasion! | WELL BALANCED PLAY: Benjamin Barlowe was an early 20th-century inventor from Fort Collins, Colorado. He believed that for children to develop properly, they required a balanced approach and needed to incorporate 5 fundamental types of activity into their play; The Artist, Writer, Inventor, Sportster, and Hero. Today, BeginAgain toys are all modeled after these principles and promote well-balanced development of the whole child!', 'ProductDimensions:3.5x3.5x2.5inches|ItemWeight:7ounces|ShippingWeight:7.2ounces(Viewshippingratesandpolicies)|DomesticShipping:ItemcanbeshippedwithinU.S.|InternationalShipping:ThisitemcanbeshippedtoselectcountriesoutsideoftheU.S.LearnMore|ASIN:B0083T8R6E|Itemmodelnumber:B1210|Manufacturerrecommendedage:12months-5years', 'https://images-na.ssl-images-amazon.com/images/I/41sXz44If9L.jpg|https://images-na.ssl-images-amazon.com/images/I/51ZJoEyY2nL.jpg|https://images-na.ssl-images-amazon.com/images/I/612hH3U-VVL.jpg|https://images-na.ssl-images-amazon.com/images/G/01/x-locale/common/transparent-pixel.jpg', '$12.99'),
(174, '5ec9d590a90fce754b08cc415627ef07', 'Snow White and The Huntsman Deluxe Queen Ravenna Costume', 'Clothing, Shoes & Jewelry | Costumes & Accessories | Women | Costumes & Cosplay Apparel | Costumes', '100% Polyester | Imported | Hand Wash | Queen ravenna\'s black dress from the movie snow white and the huntsman, | Dress commands attention with the extra high collar and shiny bodice | Available in adult sizes small (dress size 6), medium (dress size 10), and large (dress size 14) | Created in partnership with and officially licensed by universal studios | Look for the complete line of snow white and the huntsman costumes and accessories for adults, teens, and tweens; fun group costume', '', 'https://images-na.ssl-images-amazon.com/images/I/41cuvY6BzRL.jpg|https://images-na.ssl-images-amazon.com/images/I/41ws6dXL%2BXL.jpg|https://images-na.ssl-images-amazon.com/images/I/51-MNUhTXhL.jpg|https://images-na.ssl-images-amazon.com/images/G/01/x-locale/common/transparent-pixel.jpg', '$33.67 - $102.46');
