(266, 'c2cbb52a1cbbd9cbd15af7e1941b8258', 'Wildkin Kids 17 Inch Backpack', 'Clothing, Shoes & Jewelry | Luggage & Travel Gear | Backpacks', 'Textile lining | Zipper closure | Spot Clean | 17\" high | 7.5\" wide | PLAYGROUND APPROVED – Your child will be the talk of the playground with the Wildkin 17 Inch Backpack! Eye-catching patterns and a functional design come together to make this backpack a fun addition to your child’s school and travel essentials. Two padded, adjustable shoulder straps and a padded back provide a comfortable wear, while the durable top handle is perfect for hanging in a locker before heading to class. | THE PERFECT SIZE – Fill it up! The 17 Inch Backpack’s just-right size means you can bring the school supplies AND your favorite snack. Measuring 17 x 12 x 9 inches, this backpack is perfect for school, practice, and travel. Its three zippered compartments, two side water bottle pockets, and interior utility pockets and mesh pencil holder make organization a breeze, so your child can find what they need in a snap! | ULTRA-DURABLE AND EASY-TO-CLEAN – We’ve designed our 17 Inch Backpack to withstand even the toughest, homework-filled school days. Made from super durable 600-denier polyester fabric with an interior moisture-resistant nylon lining, the 17 Inch Backpack is capable of handling anything you throw at it – both inside and out. If things get a little too messy just spot clean as needed and leave open until completely dry. | TRAVEL IN STYLE – At Wildkin, we know that details matter to you and your child, and we made sure that our 17 Inch Backpack was designed with that in mind. Featuring vibrant, playful patterns, your child will love this fun new addition to their school and travel gear. | COORDINATES WITH OTHER WILDKIN GEAR – Make a theme out of it! Each 17 Inch Backpack was designed to coordinate with other Wildkin gear. From lunch boxes, to duffel bags, to sleeping bags, your child will love having their favorite designs with them on-the-go.', '', 'https://images-na.ssl-images-amazon.com/images/I/51sSjr1mjUL.jpg|https://images-na.ssl-images-amazon.com/images/I/41b5LIwYJeL.jpg|https://images-na.ssl-images-amazon.com/images/I/517RgXsrwhL.jpg|https://images-na.ssl-images-amazon.com/images/I/41GxnlgsQRL.jpg|https://images-na.ssl-images-amazon.com/images/I/51zbrQX9PiL.jpg|https://images-na.ssl-images-amazon.com/images/I/51QvgX5MONL.jpg|https://images-na.ssl-images-amazon.com/images/I/41C4pdbjMiL.jpg|https://images-na.ssl-images-amazon.com/images/G/01/x-locale/common/transparent-pixel.jpg', '$25.89'),
