(573, '1eefd4a9f26e2d87c4c6313fae4a9806', 'Wildkin 5 Pc Bedding, Twin, Heroes', 'Home & Kitchen | Bedding | Kids\' Bedding | Comforters & Sets | Comforter Sets', 'Make sure this fits by entering your model number. | SWEET DREAMS – Drifting off to slumber land is a breeze when your child is snuggled up in Wildkin’s ultra-cozy Twin Bedding Set! The 5 Piece Twin Bedding Set comes complete with a printed comforter, flat sheet, fitted bottom sheet, coordinating pillowcase, and embroidered sham. The comforter, flat sheet, and fitted sheet all fit a standard twin mattress. The matching pillowcase and embroidered sham both fit a standard pillow. Trust us, between the super soft microfiber material and bold Olive Kids pattern, little ones will be cuddled up and dreaming soundly in no time. | 100% SUPER SOFT Microfiber – Wildkin’s 5 Piece Twin Comforter features a 100% microfiber exterior that’s perfect for cozy cuddles. Its lightweight material makes the Twin Comforter breathable enough for hot summer nights, while keeping your little one nice and warm once those colder months roll around. The Twin Bedding Set is sure to keep your child super comfortable, whatever the climate may be! | ALL ABOUT THE DETAILS – At Wildkin, we know that details matter to you and your child, and we made sure that our Twin Bedding Set was designed with that in mind. Featuring vibrant, playful Olive Kids designs on each of the five included pieces, your little one will love this fun addition to their room. While the exterior of the Twin Comforter is bursting with character, the microfiber interior is solid, creating a sweet contrast. The coordinating flat sheet, fitted sheet, pillowcase, and embroidered sham tie the theme together for a bold, whimsical look that you and your child will love. | VIBRANT COLORS THAT LAST – We know that accidents happen, which is why we made our 5 Piece Twin Bedding Set easy-to-clean so your child can get back to snoozing! Just wash the pieces separately on a cold, gentle cycle and tumble dry on low heat. Our vibrant colors were made to last, so you don’t have to worry that they’ll fade after washing. | COORDINATES WITH OTHER WILDKIN ROOM DÉCOR – Make a theme out of it! Each Twin Bedding Set was designed to coordinate with other Wildkin room décor. From plush pillows, to toy chests, to storage cubes, your little one will love seeing their favorite designs pop up throughout their room.', 'ProductDimensions:86x0.5x68inches|ItemWeight:5.4pounds|ShippingWeight:7.8pounds(Viewshippingratesandpolicies)|DomesticShipping:ItemcanbeshippedwithinU.S.|InternationalShipping:ThisitemcanbeshippedtoselectcountriesoutsideoftheU.S.LearnMore|ASIN:B01BOYEURE|Itemmodelnumber:73691|Manufacturerrecommendedage:3-8months', 'https://images-na.ssl-images-amazon.com/images/I/61osmj4%2BOAL.jpg|https://images-na.ssl-images-amazon.com/images/I/61jw6ezActL.jpg|https://images-na.ssl-images-amazon.com/images/I/41k5lgkLXuL.jpg|https://images-na.ssl-images-amazon.com/images/I/51o0vuN0gfL.jpg|https://images-na.ssl-images-amazon.com/images/I/51PjZj1gyrL.jpg|https://images-na.ssl-images-amazon.com/images/I/51jVXGfiCjL.jpg|https://images-na.ssl-images-amazon.com/images/I/514CGy3Kh8L.jpg|https://images-na.ssl-images-amazon.com/images/G/01/x-locale/common/transparent-pixel.jpg', '$79.99'),
