(838, '9690414703801430d2eb09234a6c0d34', 'Brainstring Retro Brainteaser Puzzle', 'Toys & Games | Puzzles | Brain Teasers | Assembly & Disentanglement Puzzles', 'Make sure this fits by entering your model number. | DEVELOPS FINE MOTOR SKILLS AND SPATIAL REASONING – This beautiful 3d logic puzzle enhances fine motor skills and spatial reasoning skills through imagination and brain | SHARPENS LOGIC SKILLS – One of the best logic puzzles to develop critical thinking skills you can use in many areas of your life | UNTANGLE THE KNOT SO NO STRINGS TOUCH – You’ll need to untangle the knot so no strings touch and make sure there’s a solid color on each of the cube’s sides | ENDLESS COMBINATIONS AND ENDLESS FUN – This classic brainteaser puzzle isn’t that easy, so it’s one of those games puzzle workers want to keep going at and not put down | BOOSTS CRITICAL REASONING SKILLS – One of the best mind games to stimulate the brain and enhance critical reasoning skills used for work or creative projects', 'ProductDimensions:7.5x7.5x4inches|ItemWeight:7.2ounces|ShippingWeight:9.6ounces(Viewshippingratesandpolicies)|DomesticShipping:ItemcanbeshippedwithinU.S.|InternationalShipping:ThisitemcanbeshippedtoselectcountriesoutsideoftheU.S.LearnMore|ASIN:B004627JYI|Itemmodelnumber:BO5372|Manufacturerrecommendedage:8-15years', 'https://images-na.ssl-images-amazon.com/images/I/51Q%2BfgHZdWL.jpg|https://images-na.ssl-images-amazon.com/images/I/51owTY3aQBL.jpg|https://images-na.ssl-images-amazon.com/images/I/61uGsv65NtL.jpg|https://images-na.ssl-images-amazon.com/images/G/01/x-locale/common/transparent-pixel.jpg', '$16.99'),
