(905, '6b964629a56556fcffc1fd1a42d4affb', 'Fisher-Price Little People Noah\'s Ark, Frustration Free Packaging', 'Toys & Games | Toy Figures & Playsets | Playsets & Vehicles | Playsets', 'Make sure this fits by entering your model number. | Frustration Free Packaging: Easy to open, 100 percent recyclable, and less packaging waste | Toddlers can role play the classic story as they pretend to be different animals, or even Noah himself | The Ark’s deck can be removed for play inside, and easily pops back on to store everything inside | Includes 9 figures: Noah and two elephants, lions, zebras and giraffes | Add more animals to Noah’s Ark-Sold separately and subject to availability. | It’s a perfect way to help your child discover and recreate the classic story—or just have fun matching the animals The deck of the Ark easily removes for play inside', 'ProductDimensions:5x15x9inches|ItemWeight:2.55pounds|ShippingWeight:2.6pounds(Viewshippingratesandpolicies)|DomesticShipping:ItemcanbeshippedwithinU.S.|InternationalShipping:ThisitemcanbeshippedtoselectcountriesoutsideoftheU.S.LearnMore|ASIN:B00CQHYXOO|Itemmodelnumber:BMM06|Manufacturerrecommendedage:12months-5years', 'https://images-na.ssl-images-amazon.com/images/I/51Lf27efZcL.jpg|https://images-na.ssl-images-amazon.com/images/I/51e-R4wY5oL.jpg|https://images-na.ssl-images-amazon.com/images/I/51epVi8aSNL.jpg|https://images-na.ssl-images-amazon.com/images/I/51BTBtyU22L.jpg|https://images-na.ssl-images-amazon.com/images/I/51l4pQPoMLL.jpg|https://images-na.ssl-images-amazon.com/images/I/51REEjbqw2L.jpg|https://images-na.ssl-images-amazon.com/images/I/51653DlId9L.jpg|https://images-na.ssl-images-amazon.com/images/G/01/x-locale/common/transparent-pixel.jpg', '$45.36'),
