(908, '86927a1ecbd562febed68a268ef24e9e', 'Crayola Washable Palm Grasp Crayons, Amazon Exclusive, 9ct, Toddler Toys, Gift', 'Toys & Games | Arts & Crafts | Drawing & Painting Supplies | Crayons', 'Make sure this fits by entering your model number. | TODDLER CRAYON SET: Featured in this set are 9 palm-grip crayons for toddlers in classic colors including red, orange, yellow, green, blue, and purple, as well as 3 exclusive colors carnation pink, green yellow, and robins egg blue. | CRAYOLA EGG CRAYONS: The ergonomic design of these egg-shaped crayons makes them easy for toddlers to comfortably hold and scribble with. | WASHABLE CRAYONS: Washable coloring supplies make cleanup hassle-free so parents can keep their kids entertained without a messy aftermath. | 14 CRAYONS IN EVERY EGG: 1 Crayola toddler crayon egg is equivalent to 14 regular crayons., so it\'s like you have a box of crayons in every egg. | MY FIRST ART SUPPLIES: My first Crayola art supplies are intended to make creativity accessible at an early age with tools designed for stages so that kids can progress at their own natural pace.', 'ProductDimensions:10.6x8.4x4.4inches|ItemWeight:1.75pounds|ShippingWeight:1.75pounds(Viewshippingratesandpolicies)|DomesticShipping:ItemcanbeshippedwithinU.S.|InternationalShipping:ThisitemcanbeshippedtoselectcountriesoutsideoftheU.S.LearnMore|ASIN:B0791689ZG|Itemmodelnumber:81-1469|Manufacturerrecommendedage:12months-15years', 'https://images-na.ssl-images-amazon.com/images/I/51dM2gNsemL.jpg|https://images-na.ssl-images-amazon.com/images/I/41JntqfEoWL.jpg|https://images-na.ssl-images-amazon.com/images/I/51WjCVCh7ZL.jpg|https://images-na.ssl-images-amazon.com/images/I/41kaGKCNA8L.jpg|https://images-na.ssl-images-amazon.com/images/I/31DNK80PgFL.jpg|https://images-na.ssl-images-amazon.com/images/I/51mXvXOsKhL.jpg|https://images-na.ssl-images-amazon.com/images/I/61IPs86w7GL.jpg|https://images-na.ssl-images-amazon.com/images/G/01/x-locale/common/transparent-pixel.jpg', '$11.07'