(909, '2efb24558840733cac0e41d212683303', 'Breyer Freedom Series (Classics) Racing The Wind | Horse and Foal Toy Set | 1:12 Scale | Model #62208', 'Toys & Games | Toy Figures & Playsets | Action Figures', 'Make sure this fits by entering your model number. | Thoroughbred Horse and Foal Set - All Thoroughbreds can trace their bloodlines back to one of three foundation sires: The Darley Arabian, the Godolphin Arabian and the Byerly Turk. Bred to run at high speeds over varying distances while carrying a rider, modern Thoroughbreds are typically sleek and long-legged with powerful muscling. Thoroughbreds can run approximately 35-40 miles per hour, and maintain that speed over distances of 5 to 12 furlongs (5/8 mile to 1.5 miles) | PRODUCT SPECIFICATIONS: Package contains (2) Breyer Freedom Series Horses. 1 Horse and 1 Foal. Freedom Series (Classics) 1:12 Scale. Measures approximately 10\" L x 5.5\" H & 5\" L x 4\" H. Recommended for ages 4 years and older. Breyer’s Freedom Series celebrates everything there is to love about horses! | ACCESSORIES: Build an entire world with all Freedom Series accessories (sold separately) which includes realisitic Barns, Playsets, Horse and Foal sets, Fencing, Tack, Vehicles, Trailers and even Riders. | TRUE EQUESTRIAN ART: Breyer models begin as beautiful horse sculptures created by leading equine artists that are then cast into a copper and steel mold. Each model is created one at a time from the original mold, which is injected with a special resin selected by Breyer for its ability to capture the depth of detail, delicate feel and richness of color in our models. | HAND CRAFTED DETAIL: The world\'s \'most asked for\' horses since 1950. Each individual Breyer model is prepped and finished by hand and then turned over to the painting department for hand painting and detailing. In all, some 20 artisans work on each individual model horse, creating an exquisite hand-made model horse that is as individual as the horse that inspired it.',