(965, '45b93b86b9e90c75587fe4719b9d043c', 'hand2mind Learn to Read with Bob Books and VersaTiles - Sight Words Set (Ages 3-6) | Sight Words Games, 10 BOB Books, 20-Page Workbook & 1 Answer Book, Award Winning', 'Office Products | Office & School Supplies | Education & Crafts | Early Childhood Education Materials', 'Make sure this fits by entering your model number. | Learning Kit includes 10 Bob Books, 1 Versatile answer case, and a 20-page Versatile workbook with 20 hands-on learning activities | HOW IT WORKS - Simply line up the puzzle-like answer case on top of the page in the book, and line the tiles up on top to start. Pick up each tile 1-8 and answer the question underneath it. Once each tile is placed, close the case, flip it over and see if the pattern matches what is on the bottom right corner of the workbook page. Bob Books & Versatile provides your kids with the essentials they need to start learning to read words at home or school | As your beginning reader acquires 30 new sight words, you can gradually add more complexity to their learning. It is easy to make learning fun! Engage your early readers with learning to read games, it will make practice reading fun. Kids can practice their reading skills with Versatile puzzle-like answer case and workbook | The 10 Bob Books focus on letter sounds, and building up children\'s confidence to say \"I read the whole book! \" | Bob Books offers repetition and fun stories to introduce important sight words. Consistent short vowels and simple stories ensure that each book is a gentle step into early reading | Great Gifts for preschool teachers, kindergarten teachers, 1st-grade teachers, parents teach preschoolers, kindergartners, and 1st graders | Bob Books has inspired reading success for over 40 years | For over 50 years, hand2mind has encouraged hands-on learning and discovery, driving deeper understanding and helping students unlock their full potential', 'Product Dimensions:         12 x 9 x 2 inches    |Shippi