(1011, '5d953e357d08badf591931b299d2065c', 'Wildkin Kids Insulated Lunch Box for Boys and Girls, Perfect Size for Packing Hot or Cold Snacks for School and Travel, Patterns Coordinate with Our Backpacks and Duffel Bags, Wild Animals', 'Home & Kitchen | Kitchen & Dining | Storage & Organization | Travel & To-Go Food Containers | Lunch Boxes', 'Make sure this fits by entering your model number. | DO YOUR PART FOR THE ENVIRONMENT AT A GREAT PRICE – Say “goodbye” to those brown paper bag days and “hello” to a more environmentally friendly approach to lunch time. Reduce waste and save money with our reusable lunch box! | BOLD PATTERNS – Wildkin’s lunch box line is not only one of the best options on the market, but each pattern offers a fun and bold look that make it fun to carry around. Pick your favorite color or let your little one select a pattern with their favorite theme. | SUPERIOR QUALITY – Premium fabric makes this lunch box durable, sturdy and easy to clean. Insulation helps retain hot and cold temperatures throughout the day to improve food quality, freshness and taste. | TRAVEL-FRIENDLY DESIGN – Each compact, lightweight lunch box can hold a good-sized container with plenty of room for snacks, utensils and juice boxes. Features include a zippered front pocket for hiding a surprise dessert or fun note and a handy inner mesh pouch perfect for napkins and utensils. | SPACIOUS DESIGN – Measures 9.75 x 7 x 3.25 inches. You’ll find it super spacious and will have no problem fitting your lunch inside. Best of all, our lunch box is compatible with the Bentgo Kids bento box and the Yumbox Original, Panino, Tapas, and MiniSnack bento boxes. So go ahead, pack that extra treat! | COORDINATES WITH OTHER WILDKIN GEAR – Make a theme out of it! Each lunch box was designed to coordinate with other Wildkin gear. From backpacks, to duffel bags, to sleeping bags, your child will love having their favorite designs with them on-the-go. | GUARANTEED SATISFACTION – PVC, BPA and Phthalate-free makes this an eco-friendly option with an unmatched quality and a reliable replacement warranty for service you can trust. | Sturdy, durable, fabric construction | Pvc, bpa & phthalate-free | Available in lots of great patterns | Insulated and easy-to-clean | Zippered front pocket | Manufacturer recommended age: 3-15 years', '', 'https://images-na.ssl-images-amazon.com/images/I/51lWNUbDCxL.jpg|https://images-na.ssl-images-amazon.com/images/I/51R1FuCSVWL.jpg|https://images-na.ssl-images-amazon.com/images/I/413IRLI7KhL.jpg|https://images-na.ssl-images-amazon.com/images/I/51%2B0Hb6p0NL.jpg|https://images-na.ssl-images-amazon.com/images/I/41q%2B4edPTrL.jpg|https://images-na.ssl-images-amazon.com/images/I/514TWmLOvYL.jpg|https://images-na.ssl-images-amazon.com/images/I/41HGHZSzDkL.jpg|https://images-na.ssl-images-amazon.com/images/G/01/x-locale/common/transparent-pixel.jpg', '$10.88'),
