(1083, '3a5c41de4f5bc3fcd804a90fbe0c4e1f', 'Creativity for Kids Day at The Spa Deluxe Gift Set', 'Beauty & Personal Care | Foot, Hand & Nail Care | Tools & Accessories | Sets & Kits', 'Make sure this fits by entering your model number. | 30+ PIECE GIFT SET: Comes with everything you need! This ultimate spa set includes: inflatable pedicure pool, battery operated nail dryer, satin eye mask, pedicure slippers and toe separators, 4 bottles of water-based nail polish, one bottle of water based glitter polish, nail file, buffer, press-on nails, sticker nail art, cotton balls and a satin spa bag. | THROW A SPA PARTY: Have a mani-pedi party with your friends! This kit includes enough supplies for a small group and even includes a spa-party invitation you can use as your party invite! | FABULOUS MANICURES: Shape, file, decorate and design your natural nails with nail stickers or use the included press-on nails for a fabulous new look! Use the included battery operated nail dryer for the full mani experience. (2 AA Batteries not included) | PERFECT PEDICURES: Use your inflatable pedi-pool, toe separators and pedicure slippers for the full spa experience. Paint your nails with the kid-friendly polish that is water-based and non-toxic. | KID TESTED AND SAFE: This kit contains non-toxic, kid friendly nail polish. Recommended for ages 8 to 98.', 'ProductDimensions:3x13.5x16inches|ItemWeight:1.7pounds|ShippingWeight:1.7pounds(Viewshippingratesandpolicies)|DomesticShipping:Currently,itemcanbeshippedonlywithintheU.S.andtoAPO/FPOaddresses.ForAPO/FPOshipments,pleasecheckwiththemanufacturerregardingwarrantyandsupportissues.|InternationalShipping:ThisitemcanbeshippedtoselectcountriesoutsideoftheU.S.LearnMore|ASIN:B005DFRL0O|Californiaresidents:ClickhereforProposition65warning|Itemmodelnumber:1736000|Manufacturerrecommendedage:9-15years|Batteries:2AAbatteriesrequired.', 'https://images-na.ssl-images-amazon.com/images/I/51CiLXlCg5L.jpg|https://images-na.ssl-images-amazon.com/images/I/61v