(1086, '85171e194d6c72d813297d7f65c05f9f', 'PLAYABLE ART Ball, Spectrum 12', 'Toys & Games | Novelty & Gag Toys | Fidget Toys | Fidget Blocks', 'Make sure this fits by entering your model number. | Color your imagination - create an endless number of beautiful shapes and figures with these colorful, interconnected wooden balls. Each ball measures 1. 25 inches in diameter and is connected with specially designed joints, making it comfortable and easy for art ball to be twisted and turned. | Build with creativity - build elegant three-dimensional geometric shapes and challenge your imagination, or form asymmetrical sculptures of art with countless combinations of color and configuration. Take apart the balls and rearrange them for even more possibilities, and combine art ball with other products in the playableART turn connector series for additional designs. | Flexible joints - specially designed joints make the balls flexible enough to be rotated with ease, and are strong enough to allow the connected balls to stand upright. This dynamic design makes it intuitive for everyone to pick up and play, and functions as an excellent modern addition to your home or office desk. | Vibrant colors - the wooden balls are coated in an assortment of vibrant colors that complement and match each other. These German-made dyes are nontoxic and free of harmful chemicals, meeting the highest toy safety standards. | Polished wood finish - each ball is polished so that it leaves no rough or jagged edges, and feels completely smooth to the touch. Every piece of wood used in this product is from beech wood Certified by the Forest Stewardship Council (FSC), making it an and sustainable choice. Designed in Germany, Manufactured in Taiwan.', 'ProductDimensions:6x6x2inches|ItemWeight:10.4ounces|ShippingWeight:10.4ounces(Viewshippingratesandpolicies)|ASIN:B07YVMW7H7|Itemmodelnumber:A0469|Manufacturerrecommendedage:3yearsandup', 'https://images-na.ssl-images-amazon.com/images/I/41koEj%2B-OgL.jp