(1127, '8443bcff15cc96ba7223c430da08a143', 'Wonder Workshop – Dot and Dash Robot Wonder Pack for Kids 6+ – Ultimate STEM Learning Bundle – Learn Block-Based Coding – Award-Winning Digital Learning – Hours of Challenges', 'Toys & Games | Kids\' Electronics | Remote- & App-Controlled Figures & Robots', 'Make sure this fits by entering your model number. | ULTIMATE ROBOT BUNDLE: Our Wonder Pack comes with the Dot and Dash robots, building brick connectors, charging cords, a tow hook, a bulldozer bar, a launcher and balls, target stickers, a bunny ears and tail set, and a xylophone. | LEARN THE BASICS OF CODING: Dot and Dash are ready to go straight out of the box and use fun challenges to teach your child the block-based coding skills they will need for middle and high school while developing critical thinking skills. | AWARD-WINNING ROBOTS: Wonder Workshop robots are used in over 20,000 classrooms worldwide and are seen by educators as leaders in the coding robot space. The accessories in the Wonder Pack keep kids engaged and learning over time. | 5 FREE MOBILE APPS: Download 5 free apps for iOS, Android, or Kindle Fire 8 or later. Use these to help Dash and Dot sing, dance, navigate obstacles, respond to voice commands, respond to each other, and work together to solve the app challenges. | HUNDREDS OF HOURS OF CODING: The free in-app challenges give your child hundreds of hours of STEM learning, while the fun accessories let you easily turn your robots into everything from a bulldozer to a catapult for engaging freeform play.', 'ProductDimensions:6.7x7.3x6.3inches|ItemWeight:7.7pounds|ShippingWeight:7.7pounds(Viewshippingratesandpolicies)|DomesticShipping:ItemcanbeshippedwithinU.S.|InternationalShipping:ThisitemcanbeshippedtoselectcountriesoutsideoftheU.S.LearnMore|ASIN:B01M6W8XHL|Itemmodelnumber:1-WB04-01|Manufacturerrecommendedage:6yearsandup|Batteries:2Lithiumionbatteriesrequired.(included)', 'https://images-na.ssl-images-amazon.com/images/I/51Lq9TjOCYL.jpg|https