(1129, 'a5b115b9d2ad3a3bee270d442b5155df', 'MightySkins Skin Compatible with Razor A2 Kick Scooter - Rainbow Streaks | Protective, Durable, and Unique Vinyl Decal wrap Cover | Easy to Apply, Remove, and Change Styles | Made in The USA', 'Sports & Outdoors | Outdoor Recreation | Skates, Skateboards & Scooters | Scooters & Equipment | Accessories', 'SET THE TREND: Show off your own unique style with MightySkins for your Razor A2 Kick Scooter! Don’t like the Rainbow Streaks Design? We have hundreds of designs to choose from, so your Razor A2 Kick Scooter will be as unique as you are! | DURABLE PROTECTION FOR YOUR DEVICE: Manufactured with ultra-thin, ultra-durable, stain-resistant laminate vinyl in order to effectively protect your gear from dings, scrapes, dust, and the wear and tear of everyday use! MightySkins a SOFT vinyl skin cover, is not made of rubber, silicone or plastic & it is NOT a HARD case | GOES ON AND COMES OFF EASY: Apply your MightySkins vinyl decal easily & with precision on your Razor A2 Kick Scooter thanks to a patented low grip air release adhesive that’s built to last but removes easily and leaves no sticky residue when you’re ready to switch to a different design! | SATISFACTION : Our friendly, knowledgeable staff is here to help and customer satisfaction is our top priority! If you have any issues with your order or you’re not happy for any reason, just let us know and we’ll be there to help! | PROUDLY MADE IN THE USA: Buy with confidence from an American owned and operated company! MightySkins are produced in our state-of-the-art facility in West Palm Beach, Florida, proudly made in the U. S. A. !', 'ProductDimensions:18x0.1x20inches|ItemWeight:0.16ounces|ShippingWeight:0.96ounces|ASIN:B07MJ7LJ3R|Itemmodelnumber:RAA2KS-RainbowStreaks', 'https://images-na.ssl-images-amazon.com/images/I/31R1-pU08LL.jpg|https://images-na.ssl-images-amazon.com/images/I/51kfskbkPmL.jpg|https://images-na.ssl-images-amazon.com/images/G/01/x-locale/common/transparent-pixel.jpg', ''),
